import React  from "react";
import './YearFilter.css';
import LargeComponent from "../ItemsCollection/LargeComponent";
import Card from "../MainCard/Card";

const FilterYear = (props) => {
    let items
    return (
        <div>
            <div className="FilterCard">
                <Card>
                    <div className="Filter">
                        <label>Filter By Year</label>
                        <select>
                            <option value="2019" onChange={Handler1}>2019</option>
                            <option value="2020" onChange={Handler2}>2020</option>
                            <option value="2021" onChange={Handler3}>2021</option>
                            <option value="2022" onChange={Handler4}>2022</option>
                        </select>
                    </div>
                </Card>
                <Card>
                    <LargeComponent items= {items} /*onExecute={ExectionHandler}*//>
                </Card>
            </div>
        </div>
    );
};
export default FilterYear;
